let texto = $json.text || '';
// let texto = $input.first().json.data|| '';
// Eliminar bullets y caracteres especiales visuales
texto = texto.replace(/[•●▪◆►■]/g, '');

// Eliminar secuencias repetidas tipo .., . ., · ·, - -
texto = texto
  .replace(/([.·\-•])(\s*\1)+/g, '')  // elimina repeticiones . . . o - - -
  .replace(/([•·])+/g, '')            // bullets extra
  //.replace("*","-")

// Reemplazar saltos de línea por espacio
texto = texto.replace(/(\r\n|\n|\r)/gm, ' ');

// Reducir múltiples espacios a uno solo
texto = texto.replace(/\s+/g, ' ').trim();

return [{ json: { texto_limpio: texto } }];

